import React, { useState } from 'react';
import { teamData } from './TeamData';

const Ladder = () => {
  const [teams] = useState(teamData);

  return (
    <div>
      <h3 style={{ color: "#a18525" }}>Ladder</h3>
      <table>
        <thead>
          <tr>
            <th>Ranking</th>
            <th>Team</th>
            <th>Won</th>
            <th>Lost</th>
            <th>Points</th>
          </tr>
        </thead>
        <tbody>
          {teams.map((team) => (
            <tr key={team.ranking}>
              <td>{team.ranking}</td>
              <td>{team.team}</td>
              <td>{team.won}</td>
              <td>{team.lost}</td>
              <td>{team.points}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Ladder;
